(14, 'Tentang pekerjaan ini \nLowongan ini berasal dari bursa lowongan pekerjaan. Pelajari Lebih Lanjut \nQualification \n \nMinimal pendidikan S1 Teknik Sipil \nMinimal pengalaman 3-5 tahun di bidang yang sama \nFamiliar dan mampu menggunakan software software civil \nMampu mebuat BoQ, RAB, RAP, danmelakukan control pekerjaan \nMemiliki keterampilan komunikasi dan manajemen proyek. \n \nJob Description \n \nMerencanakan proyek pekerjaan, melakukan survei tanah dan mengumpulkan data \nMembuat gambar dengan software drawing dan perhitungan struktural untuk memastikan kekuatan dan \nkeamanan pekerjaan \nMembantu tim sipil dalam pelaksanaan proyek \nMembuat RAB bangunan dan mengerti konstruksi gedung \nBisa menganalisa permasalahan bangunan gedung dan follow up pekerjaanya \nBersedia ditugaskan di Site seluruh Indonesia.', 'uploads\\CV_YELSA_HANIFAH_ARDIN_NEW_-_Yelsa_Hanifah.pdf', 88.4863, 5, 'YELSA HANIFAH AR<span style=\"background-color: yellow\"><span style=\"background-color: yellow\">DI</span></span>N   \nASSOCIATE DEGREE OF <span style=\"background-color: yellow\">CIVIL</span> ENGINEERING  \nPROFIL  \nLulusan D3 <span style=\"background-color: yellow\">Teknik</span> <span style=\"background-color: yellow\"><span style=\"background-color: yellow\">Sipil</span></span> Universitas Sebelas Maret pada <span style=\"background-color: yellow\">tahun</span> 2023 (fresh graduate), \nsaya berumur 22 <span style=\"background-color: yellow\">tahun</span> . Saya memahami <span style=\"background-color: yellow\">tentang</span> pembuatan precast <span style=\"background-color: yellow\"><span style=\"background-color: yellow\"><span style=\"background-color: yellow\"><span style=\"background-color: yellow\"><span style=\"background-color: yellow\"><span style=\"background-color: yellow\"><span style=\"background-color: yellow\">dan</span></span></span></span></span></span></span> readymix, \ndapat mengoperasikan aplikasi <span style=\"background-color: yellow\">teknik</span>  <